description:
The IT Crowd Manual

Arts Documentary hosted by Stephen Mangan, published by Channel 4 in 2013 - English narration


Information
------------------------------

Stephen Mangan narrates this behind-the-scenes documentary that features interviews with the cast Richard Ayoade, Chris O'Dowd and Katherine Parkinson, as well as much-loved guest stars Noel Fielding and Matt Berry.
Plus a host of celebrity fans including Paul Whitehouse share their love of the show.

